class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        valid_indices = []

        word_count_dict = {}
        for word in words:
            if word not in word_count_dict:
                word_count_dict[word] = 0

            word_count_dict[word] += 1

        word_len = len(words[0])
        num_words = len(words)

        word_variations_dict = {}

        for x in xrange(0, word_len):
            word_list = []
            iter_idx = x
            while iter_idx < len(s):
                word_list.append(s[iter_idx:iter_idx+word_len])
                iter_idx += word_len

            word_variations_dict[x] = word_list

        #print word_variations_dict

        for x in xrange(0, word_len):
            word_list = word_variations_dict[x]

            #print len(word_list), num_words
            for y in xrange(0, len(word_list) - num_words + 1):
                iter_count_dict = {}

                word_slice = word_list[y:y+num_words]
                for word in word_slice:
                    if word not in iter_count_dict:
                        iter_count_dict[word] = 0
                    iter_count_dict[word] += 1

                #print word_count_dict, iter_count_dict
                if word_count_dict == iter_count_dict:
                    valid_indices.append(x + y * word_len)

        return valid_indices

